import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './Login'; // Ensure this is the correct path to Login.js
import ForgotPassword from './ForgotPassword'; // Ensure this is the correct path to ForgotPassword.js
import PasswordReset from './Newpassword'; // Ensure this is the correct path to Newpassword.js

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Login />} /> {/* Default route to Login */}
          <Route path="/login" element={<Login />} />
          <Route path="/forgot-password" element={<ForgotPassword />} />
          <Route path="/reset-password" element={<PasswordReset />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
